(1, '<p><strong>PRIVACY POLICY</strong></p>\r\n\r\n<p>Welcome to <a href=\"http://www.domain.com/\">the BusinessManagementapp</a>&nbsp; (the &ldquo;Site&rdquo;), a website operated by Social Enterprises LLC(&ldquo;Company,&rdquo; &ldquo;us,&rdquo; &ldquo;our,&rdquo; and &ldquo;we&rdquo;). We are committed to maintaining robust privacy protections for our users. We provide the Site and services provided through the Site (the Site and services will be collectively referred to as the &ldquo;Services&rdquo;). Our Privacy Policy (&ldquo;Privacy Policy&rdquo;) is designed to help you understand how we collect, use&nbsp; and safeguard the information you provide to us and to assist you in making informed decisions when&nbsp; using ourService.</p>\r\n\r\n<p>By accepting our Privacy Policy, you consent to our collection, storage, use and disclosure of your personal information as described in this Privacy Policy.</p>\r\n\r\n<h3>Types of Data We Collect</h3>\r\n\r\n<p>We collect &ldquo;Non-Personal Information&rdquo; and &ldquo;Personal Information.&rdquo; Non-Personal Information includes information that cannot be used to personally identify you, such as anonymous usage data, general demographic information we may collect, referring/exit pages and URLs, platform types, preferences you submit and preferences that are generated based on the data you submit and number of clicks. &ldquo;Personal Information&rdquo; means data that allows someone to identify or contact you, including, for example, your name, address, telephone number, email address, as well as any other non-public information about you that is associated with or linked to any of the foregoing data.</p>\r\n\r\n<p><strong>Children&rsquo;s Online Privacy Protection Act</strong></p>\r\n\r\n<p>We do not intentionally gather Personal Information from visitors who are under the age of 13.</p>\r\n\r\n<p><strong>Information You Provide to Us</strong></p>\r\n\r\n<ul>\r\n	<li>We may collect personal information from you such as your first and last Name ,email&nbsp;address&nbsp;and&nbsp;password when you create an account to log into our network(&ldquo;Account&rdquo;).</li>\r\n	<li>When you subscribe to the Services on our Site, our payment processor will collect all information necessary to complete the transaction, including your name, credit card information, billing information, and direct deposit information&nbsp;</li>\r\n	<li>We&nbsp;Retain information on your behalf such as files and message that you store using your Account&nbsp;</li>\r\n	<li>If you provide us feedback or contact us via email, we will collect your name and email address, as well as any other content included in the email ,in order to send you a reply.</li>\r\n	<li>When you participate in one of our surveys, we may collect additional information that you knowingly provide.</li>\r\n	<li>When you post messages on the Services or on a Social Media Site (&ldquo;SMS&rdquo;) where we have a page&nbsp;&nbsp; or presence (collectively &ldquo;SMS Pages&rdquo;), the information contained in your posting may be republished on our Site and other users may be able to see them.</li>\r\n	<li>We will maintain the information you send via email in accordance with applicable federallaw.</li>\r\n	<li>In compliance with the CAN-SPAM Act, all emails sent from our organization will clearly state who the email lisfromand provide clear informationon how to contact the sender.In addition,all email&nbsp; &nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<p>messages will also contain concise information on how to remove yourself from our mailing list so that you receive no further e-mail communication from us.Our emails provide users the opportunity to&nbsp; opt-out&nbsp; of&nbsp; receiving&nbsp; communications&nbsp; from&nbsp; us&nbsp; and&nbsp; our&nbsp; partners&nbsp; by&nbsp; reading&nbsp; the&nbsp;&nbsp;&nbsp;unsubscribe instructions located at the bottom of any email they&nbsp; receive&nbsp; from&nbsp; us&nbsp; at&nbsp; anytime.Users who no longer wish to receive our newsletter&nbsp; or&nbsp; promotional&nbsp; materials&nbsp; may&nbsp; opt-out of receiving these communications by clicking on the unsubscribe link in the email.</p>\r\n\r\n<p><strong>Information Collected via Technology</strong></p>\r\n\r\n<ul>\r\n	<li>We may&nbsp; also&nbsp; use&nbsp; third&nbsp; party&nbsp; analytics services&nbsp; such&nbsp; as&nbsp; Google&nbsp;Analytics or Google&nbsp; Adsense&nbsp;to collect information about how you use and interact with our Services.&nbsp; Such&nbsp; third-party&nbsp; analytics services may use cookies to gather information such as the pages you visited, your address, adate/timestamp for your visit and which site referred you to the Site.</li>\r\n	<li>We&nbsp; reserve the&nbsp; right&nbsp; to&nbsp; use&nbsp; technological&nbsp; equivalents&nbsp; of&nbsp; cookies,&nbsp; including&nbsp; social&nbsp;&nbsp; media pixels. These pixels allow social media sites to track visitors to outside websites so as to tailor advertising messages&nbsp;users&nbsp; see&nbsp; while&nbsp; visiting&nbsp; that social&nbsp; media&nbsp; website. We&nbsp; reserve the&nbsp; right&nbsp;&nbsp; to use the se pixels incompliance with the policies of the various social media sites.</li>\r\n	<li>Some content or applications,including advertisements,on the Site are served third-parties,including advertisers, ad networks and servers, content providers, and application providers. These third parties may use cookies alone or&nbsp; in&nbsp;conjunction&nbsp; with&nbsp; web&nbsp;beacoms&nbsp; or&nbsp; other tracking technologies to collect information about you when you use our website. The information they collect may be associated with your personal information or they may collect information, including personal information,about your online activities over time and across different websites and other online&nbsp; services.&nbsp; They&nbsp; may&nbsp; use&nbsp; this&nbsp; information&nbsp;to&nbsp;provide&nbsp;you&nbsp;&nbsp; with&nbsp; interest-based&nbsp; (behavioral) advertising or other targeted content&nbsp;We do not control these&nbsp; third parties&#39; tracking technologies or&nbsp; how&nbsp; they&nbsp; may&nbsp; be&nbsp; used.&nbsp; If&nbsp;&nbsp; you&nbsp;&nbsp; have&nbsp;&nbsp; any&nbsp;&nbsp; questions about an advertisement or other targeted content, you should contact the responsible provider directly.</li>\r\n</ul>\r\n\r\n<p><strong>Use of Your Personal Information</strong></p>\r\n\r\n<p>In general, Personal Information you submit to us is used either to respond to requests that you make, or to&nbsp;&nbsp;aid using serving you better.We use your Personal&nbsp;Information in the following ways</p>\r\n\r\n<ul>\r\n	<li>to facilitate the creation of and secure your Account on our network</li>\r\n	<li>to identify you as a user in oursystem;</li>\r\n	<li>to provide improved administration of our Services</li>\r\n	<li>to provide the Services you request;</li>\r\n	<li>to improve the quality of experience when you interact with ourServices</li>\r\n	<li>to send you a welcome email to verify ownership of the email address provided when your Account was created&nbsp;</li>\r\n	<li>to perform marketing or dataanalysis.</li>\r\n</ul>\r\n\r\n<p>If you opt to receive any free resources&nbsp;participate in any free training programs&nbsp;register for a webinar register for a live event&nbsp;register for a seminar&nbsp;or purchase any products sold by us on this&nbsp;we will only enroll you to receive our free email newsletter you can unscribe any time we provide unscribe link bottem of email that we have send&nbsp; If you ever have trouble unsubscribing&nbsp;you can send an email to the email address provided below in order to request to unsubscribe from future emails</p>\r\n\r\n<p><strong>Location based data</strong></p>\r\n\r\n<p>We make use of &nbsp;location-based &nbsp;data &nbsp;for &nbsp;our &nbsp;website &nbsp;to &nbsp;connect &nbsp;you &nbsp;with &nbsp;other &nbsp;users &nbsp;near &nbsp;you &nbsp;that can either oer or are in need of the Services. If you choose not to allow us to access your location, some or all functionality may not be available to you.</p>\r\n\r\n<p><strong>Disclosure of Your Personal Information</strong></p>\r\n\r\n<p>As a general rule, we do not sell&nbsp;&nbsp;rent&nbsp;lease or otherwise transfer any information collected either automatically or&nbsp;through your voluntary action We may disclose your Personal Information as described below and as described elsewhere in this Privacy Policy</p>\r\n\r\n<p>Other Disclosures Regardless of any choices you make regarding your Personal Information (as described below)&nbsp;we may disclose Personal Information if it believes in good faith that such disclosure is necessary&nbsp;in connection with any legal investigation to comply with relevant lawsor to respond to sub poenas&nbsp;</p>\r\n\r\n<p>or warrants served on us to protect or defend our rights or property, or the rights or property of users of the Services andor (d) to investigate or assist in preventing any violation or potential violation of the law, this Privacy Policy, or Terms of Use.</p>\r\n\r\n<p>Links to Third Party Websites</p>\r\n\r\n<p>As part of the Service, we may provide links to or compatibility with other websites or applications.&nbsp;&nbsp; However,&nbsp; we are not responsible for the privacy practices employed by those websites or the information&nbsp;&nbsp; or content they contain. This Privacy Policy&nbsp; applies&nbsp; solely&nbsp; to&nbsp; information&nbsp; collected&nbsp; by&nbsp; us&nbsp; through&nbsp; the&nbsp; Site and&nbsp; the Service.&nbsp; Therefore,&nbsp; this&nbsp; Privacy&nbsp; Policy&nbsp; does&nbsp; not&nbsp; apply&nbsp; to&nbsp; your&nbsp; use&nbsp; of&nbsp; a&nbsp; third&nbsp; party&nbsp; website&nbsp;&nbsp; accessed&nbsp;&nbsp; by selecting a link on our Site or via our Service. To&nbsp; the extent that you access or use&nbsp;&nbsp;&nbsp; the Service through or on another website or application, then the privacy policy of that other website or application will apply to your access or use of that site or application. We encourage our users to read the privacy statements of other websites before proceeding to usethem.</p>\r\n\r\n<p>Your Rights Regarding the Use of Your Personal Information</p>\r\n\r\n<p>You have the right at any time to prevent us from contacting you for marketing purposes. When we send a promotional&nbsp; communication&nbsp; to&nbsp; a&nbsp; user,&nbsp; the&nbsp; user&nbsp; can&nbsp; opt&nbsp; out&nbsp; of&nbsp; further&nbsp; promotional&nbsp; communications by following the unsubscribe instructions&nbsp; provided&nbsp; in&nbsp; each&nbsp; promotional&nbsp; email.&nbsp; If&nbsp; applicable,&nbsp; you&nbsp; can&nbsp; also indicate that you do not wish to receive marketing communications from us in the &ldquo;Settings&rdquo; section of your Account. Please note that notwithstanding the promotional preferences you indicate by either unsubscribing or opting out in the Settings section of your Account, we may continue to send you administrative emails including, for example, periodic updates to our PrivacyPolicy.</p>\r\n\r\n<p>Security of Your Personal Information</p>\r\n\r\n<p>We implement&nbsp; security&nbsp; measures&nbsp; designed&nbsp; to&nbsp; protect&nbsp; your&nbsp; information&nbsp; from&nbsp; unauthorized&nbsp; access.&nbsp; Any&nbsp; account&nbsp; you have with our Site is&nbsp; protected&nbsp; by&nbsp; your&nbsp; account&nbsp; password&nbsp;&nbsp; and&nbsp;&nbsp; we&nbsp;&nbsp; urge&nbsp;&nbsp; you&nbsp;&nbsp; to take&nbsp; steps&nbsp;&nbsp; to&nbsp;&nbsp; keep&nbsp;&nbsp; your&nbsp;&nbsp;personal information safe by not disclosing your password and by logging out of your account after each use.We further&nbsp; protect&nbsp; your&nbsp; information&nbsp; from&nbsp; potential&nbsp; security&nbsp; breaches&nbsp; by&nbsp; implementing&nbsp;&nbsp; certain&nbsp;&nbsp;technological security measures However,&nbsp;these measures do not guarantee that your information will not be accessed, disclosed, altered or destroyed by&nbsp; breach&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Visitors&rsquo; GDPR Rights</p>\r\n\r\n<p>If you are within the European Union, you are entitled to certain information and have certain rights under the General Data Protection Regulation (the &ldquo;GDPR&rdquo;). Those rights include the following:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:circle\">\r\n		<li>We will retain any information you choose to provide to us until one of the following happens: (a) youaskustodeletetheinformation,(b)wedecidetoceaseusingourexistingdataproviders,or</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>(c) we decide that the value in retaining the data is outweighed by the costs of retaining it.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:circle\">\r\n		<li>You have the right to request access to your data that we store and the rights to either rectify or erase your personaldata.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul style=\"list-style-type:circle\">\r\n		<li>You have the right to seek restrictions on the processing of your data.You have the right to object&nbsp; to the processing of your data and the right to the portability of yourdata.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Changes to This Privacy Policy</p>\r\n\r\n<p>We&nbsp;&nbsp; reserve&nbsp; the&nbsp; right&nbsp; to&nbsp; change&nbsp; this&nbsp; policy&nbsp; and&nbsp; our&nbsp; Terms&nbsp;&nbsp; of&nbsp; Service&nbsp; at&nbsp; any&nbsp; time.&nbsp; we may notify you significant changes to our privacy policy by sending you a notice to the primary email address specified in your account or by placing a prominenent notice on our site.Significant changes will go into the effect&nbsp; 30 days following such notification.Non material changes or clarifications will take effect immediately .You should periodcally check the site and this privacy page for updates.</p>\r\n\r\n<p>Contact Information</p>\r\n\r\n<p>If you have any questions regarding this Privacy Policy or the practices of the Site, please contact us by sending an email to socialenterprisesapps@gmail.com.</p>\r\n\r\n<p>Last Updated</p>\r\n\r\n<p>This Privacy Policy was last updated on 08/20/20.</p>\r\n\r\n<p>&nbsp;</p>', '2020-07-08 02:01:00', '2020-10-22 01:23:23');
